import React, { Component } from 'react';
import './Styles/Form.css';

class Form extends Component {
    render() {
        return (
            <div id="Form">
                <div id="FormText">
                    Have any Questions? Feel free to communicate. 
                    We will get back to you within 24 hours.
                </div>
            </div>
        );
    }
}

export default Form;
